webpackJsonp([85617563917824],{674:function(e,i){e.exports={data:{site:{siteMetadata:{title:"Alexandre Magno Blog",author:"Alexandre Magno Monteiro"}},markdownRemark:{id:"/Users/alexandre/Documents/gatsby-make-post/create-gatsby-post-api/repositories/amagno-gatsby-blog/src/pages/talks-git-github/index.md absPath of file >>> MarkdownRemark",html:'<h4>Esta palestra tem como objetivo explicar como funciona o Sistemas de controle de versão abordando, Git e Github e sua utilidade no dia a dia de um programador.</h4>\n<ul>\n<li>Introdução</li>\n<li>Vida de programador</li>\n<li>De que forma armazenar esses softwares ?</li>\n<li>Um programa que tenha dois ou mais desenvolvedores</li>\n<li>Sistemas de Controle de Versão</li>\n<li>Alguns Sistemas de Controle de Versão existentes</li>\n<li>Pra que Serve um Sistema de Controle de Versão</li>\n<li>Como Funciona um Sistema de Controle de Versão</li>\n<li>O Git</li>\n<li>Quem inventou o Git</li>\n<li>Como usar o Git</li>\n<li>Upload em um repositório remoto</li>\n<li>Hosts de repositórios</li>\n<li>O Github</li>\n<li>Alguns dados sobre o Github</li>\n<li>O que existe dentro do Github</li>\n<li>Empresas que usam o Github</li>\n<li>A importâcia deste conteúdo para um programador</li>\n<li>Utilizando o Github</li>\n<li>Github Pages</li>\n<li>Criando uma página no Github Pages</li>\n<li>Guias e Tutoriais sobre Git &#x26; Github</li>\n<li>Conclusão</li>\n</ul>\n<hr>\n<h4>Referências:</h4>\n<blockquote>\n<p>CAETANO, C. CVS. [s.l.] ed. Novatec, 2004.\nCVS – Wikipédia, a enciclopédia livre. Disponível em: <a href="https://pt.wikipedia.org/wiki/CVS">https://pt.wikipedia.org/wiki/CVS</a> Acesso em: 11 maio. 2017.\nGit - Book. Disponível em: <a href="https://git-scm.com/book/en/v2">https://git-scm.com/book/en/v2</a> Acesso em: 13 maio. 2017.\nGit User’s Manual. [s.l: s.n.].\nGitHub – Wikipédia, a enciclopédia livre. Disponível em: <a href="https://pt.wikipedia.org/wiki/GitHub">https://pt.wikipedia.org/wiki/GitHub</a> Acesso em: 11 maio. 2017.\nGitHub Octoverse 2016. Disponível em: <a href="https://octoverse.github.com">https://octoverse.github.com</a> Acesso em: 11 maio. 2017.\nGitHub Pages | Websites for you and your projects, hosted directly from your GitHub repository. Just edit, push, and your changes are live. Disponível em: <a href="https://pages.github.com/">https://pages.github.com/</a> Acesso em: 13 maio. 2017.\nMCVOY, L. BitKeeper: Why SCCS, rather than RCS? [s.l: s.n.].\nMercurial – Wikipédia, a enciclopédia livre. Disponível em: <a href="https://pt.wikipedia.org/wiki/Mercurial ">https://pt.wikipedia.org/wiki/Mercurial</a> Acesso em: 11 maio. 2017.\nMIKKELSEN, T. P. S. Parctical Software Configuration Management. Upper Saddle River, NJ, EUA: Prentice Hall PTR, 1997.\nMOLINARI, L. Gerência de Configuração - Técnicas e Práticas no Desenvolvimento do Software. Florianópolis: Visual Books, 2007.\nProjects that use Git for their source code management. [s.l: s.n.].\nStack Overflow Developer Survey 2015. Stack Overflow, [s.d.].\nSVN. [s.l.] Collab Net, [s.d.].\nTORVALDS, L. Linux 2.6.12. [s.l: s.n.].\nWOHLER, B. Unix — Frequently Asked Questions (7/7). [s.l: s.n.].</p>\n</blockquote>\n<p><a href="presentation/">Iniciar Apresentação</a></p>',frontmatter:{title:"Palestra Git e Github",date:"May 18, 2017"}}},pathContext:{slug:"/talks-git-github/",previous:!1,next:{fields:{slug:"/teste/"},frontmatter:{title:"Teste"}}}}}});
